window.bookSummaryJSON = "<p>Straight out of the pages of the legendary vampire novel <i>Dracula</i> comes a demon hunter for the modern world. </p> <p>Mina Murray and Jonathan Harker had a son. They named him Quincy. His guardian angel calls him Q. Dracula calls him nephew. </p> <p>Demons call him The Reaper. </p> <p>\"There are things in this world that men and women aren't meant to understand. We aren't supposed to know these things exist, much less how to fight them. The things that go bump in the night, the monsters in the closet, the shadow out of the corner of your eye - that's where I live.\" </p> <p>Collects the first four Quincy Harker, Demon Hunter novellas: </p> <p></p> <ul> <li><i>Raising Hell</i> </li> <li><i>Straight to Hell</i> </li> <li><i>Hell on Heels</i> </li> <li><i>Hell Freezes Over</i> </li> </ul> <p></p>"; 
